function splicPath(name, singer, string) {
  if (string)
    return LOCAL + name + "-" + singer + "." + string
}

function returnPath(name, singer) {
  return $file.exists(splicPath(name, singer, "flac")) ? splicPath(name, singer, "flac") : splicPath(singer, singer, "mp3");
}

function returnAPI(index) {
  if (index)
    return qapi
  else
    return api
}

function alignment() {
  if (playinfo.singer.singer == cellData.singer.singer && playinfo.id.text == cellData.id.text)
    return true
  else return false
}

function updataLocalList() {
  data = []
  local = $file.list(LOCAL)
  if (local.length) {
    for (let key = 0; key < local.length; key++) {
      res = local[key].split(".")
      data.push({
        path: LOCAL + local[key],
        type: {
          text: '类型：' + res.pop(),
        },
        name: {
          text: res.join('.'),
          shared: local[key]
        }
      })
    }
  }
  else {
    data.push({
      name: {
        text: name = "你还没已下载歌曲哦~",
      }
    })
  }
  return data
}

function transTime(value) {
  function formatTime(value) {
    var time = "";
    var s = value.split(':');
    var i = 0;
    for (; i < s.length - 1; i++) {
      time += s[i].length == 1 ? ("0" + s[i]) : s[i];
      time += ":";
    }
    time += s[i].length == 1 ? ("0" + s[i]) : s[i];

    return time;
  }

  var time = "";
  var h = parseInt(value / 3600);
  value %= 3600;
  var m = parseInt(value / 60);
  var s = parseInt(value % 60);
  if (h > 0) {
    time = formatTime(h + ":" + m + ":" + s);
  } else {
    time = formatTime(m + ":" + s);
  }

  return time;
}

function makeTimer() {
  timer = $timer.schedule({
    interval: 0.1,
    handler: function () {
      $thread.background({
        delay: 0,
        handler: function () {
          data = $("lrcPage").data
          offset = String($audio.offset.toFixed(0))
          if ($audio.status == 2) {
            $ui.loading(false)
            $("slider").value = $audio.offset
            $("startTime").text = transTime($audio.offset)
            $("slider").max = $audio.duration
            $("stopTime").text = transTime($audio.duration)
            if (offset <= 0) {
              $("lrcPage").data = LRC
            }
            if (data) {
              for (const key in data) {
                if (offset == data[key].index) {
                  $("lrcPage").scrollTo({
                    indexPath: $indexPath(0, key),
                    position: 2,
                    animated: true
                  })
                }
              }
            }
          }
          else if ($audio.status == 0) {
            if (transTime($audio.offset) >= transTime($audio.duration) && $("menuList").data) {
              PlayIndex = PlayIndex + 1
              if (PlayIndex < $("menuList").data.length) {
                $ui.toast("自动下一首...")

                cellData = playinfo = $("menuList").data[PlayIndex]
                $thread.background({
                  delay: 0,
                  handler: function () {
                    musicPlay(playinfo)
                    if ($("MusicCard")) {
                      $("MusicSinger").text = playinfo.singer.singer;
                      $("MusicTitle").text = playinfo.title.text;
                      $("Musicimage").src = playinfo.image.src;
                    }
                  }
                })
              }
            }
            killTimer()
          }
        }

      })
    }
  })
}

function killTimer() {
  timer.invalidate()
}

function getLrc(url) {
  function parseLyric(lrc) {
    LRC = []
    var lrcObj = {};
    var lyrics = lrc.split("\n");
    for (var i = 0; i < lyrics.length; i++) {
      var lyric = decodeURIComponent(lyrics[i]);
      var timeReg = /\[\d*:\d*((\.|\:)\d*)*\]/g;
      var timeRegExpArr = lyric.match(timeReg);
      if (!timeRegExpArr) continue;
      var clause = lyric.replace(timeReg, '');
      for (var k = 0, h = timeRegExpArr.length; k < h; k++) {
        var t = timeRegExpArr[k];
        var min = Number(String(t.match(/\[\d*/i)).slice(1)),
          sec = Number(String(t.match(/\:\d*/i)).slice(1));
        var time = min * 60 + sec;
        if (clause)
          lrcObj[time] = clause;
      }
    }
    if (lrcObj) {
      for (let i in lrcObj) {
        LRC.push({
          index: i,
          lrc: {
            text: lrcObj[i]
          }
        })
      }
    }
    $("lrcPage").data = LRC
  }

  $http.get({
    url: url,
    handler: function (res) {
      parseLyric(res.data)
    }
  })
}

function getURL(api) {
  function updata(stories) {
    var data = []
    $cache.remove("cache")
    let count = stories.count
    for (var id = 0; id < count; id++) {
      story = stories.data[id]
      data.push({
        url: story.url,
        lrc: story.lrc,
        image: {
          src: story.pic
        },
        imageR: {
          src: story.pic
        },
        id: {
          id: story.id,
          text: story.id + platform()
        },
        title: {
          text: story.title
        },
        singer: {
          singer: story.singer,
          text: '歌手:' + story.singer
        },
        mv: {
          alpha: story.mvurl ? 0.6 : 0.1,
        },
        path: {
          alpha: $file.exists(splicPath(story.title, story.singer, "mp3")) || $file.exists(splicPath(story.title, story.singer, "flac")) ? 0.6 : 0
        },
        flac: {
          url: story.flac,
          mvurl: story.mvurl,
          alpha: story.flac ? 0.6 : 0.1
        }
      })
    }
    $ui.loading(false)
    $cache.set("cache", data)
    $("menuList").data = data
    $("menuList").endRefreshing()
  }

  $("menuList").beginRefreshing()
  $ui.loading(true)
  $ui.toast("数据正在获取中,请稍后...")
  $http.get({
    url: api,
    handler: function (res) {
      updata(res.data)
    }
  })
}

function musicPlay(object) {
  $ui.loading(true);
  path = returnPath(object.title.text, object.singer.singer);
  if (playinfo == null || $audio.status == 0) {
    playinfo = object
    if ($file.exists(path)) {
      $audio.play({
        path: path
      })
      $ui.toast('文件已存在，使用本地文件播放...')
    }
    else {
      $audio.play({
        url: object.url
      })
      $ui.toast('歌曲正在缓冲,请稍后...')
    }
    $thread.background({
      delay: 0,
      handler: function () {
        makeTimer()
        getLrc(object.lrc)
        $("playingBarText").text = playinfo.title.text;
        $("playingBarSrc").src = $audio.status ? stopicon : playicon;
      }
    })
  }
}

function playToggle() {
  if (alignment()) {
    if ($audio.status == 2) {
      killTimer()
      $audio.pause()
      $ui.loading(false)
      $("playingBarSrc").src = playicon;
      $("playingBarText").text = playinfo.title.text;
      $("PlayBottom").src = playicon;
    }
    else if ($audio.status == 0) {
      makeTimer()
      $audio.resume()
      $ui.loading(false)
      $("playingBarSrc").src = stopicon;
      $("playingBarText").text = playinfo.title.text;
      $("PlayBottom").src = stopicon;
    }
  }
  else {
    killTimer()
    $audio.stop()
    musicPlay(cellData)
    $("playingBarSrc").src = stopicon;
    $("playingBarText").text = playinfo.title.text;
    $("PlayBottom").src = stopicon;
  }
}

function isPlaying() {
  if (alignment()) {
    if ($audio.status != 0)
      return stopicon
  }
  else
    return playicon
}

function platform() {
  let platform
  if (isQQ) {
    platform = ' | QQ'
  } else {
    platform = ' | WY'
  }
  return platform
}

function isWY() {
  if (keyword == undefined || keyword.indexOf('music.163.com') == -1) {
    return true
  } else {
    return false
  }
}

function getTure(s) {
  if (s) {
    return 'TRUE'
  } else {
    return 'FALSE'
  }
}

function fileExit(object, statu) {
  switch (statu) {
    case 1:
      if (!$file.exists(object)) {
        $file.mkdir(object)
      }
      break;
    case 2:
      if (!$file.exists(object) || isDownload == object)
        return downloadicon
      else
        return deleteicon
      break;
  }
}

function saveMusic(data, path, object) {
  $file.write({
    data: data,
    path: path
  })
  isDownload = null
  if (!findPathSame(path))
    savePathData(path, object)

  $ui.toast("下载成功,歌曲已在本地保存")
}

function deleteMusic(path) {
  if ($file.exists(path)) {
    $file.delete(path)
    $ui.toast("歌曲文件已删除...")
    $("musicPageDown").src = downloadicon
  }

}

function downloader(object) {
  if (!isDownload) {
    if (!object.flac.url)
      items = ["高清"]
    else
      items = ["高清", "无损"]
    $ui.menu({
      items: items,
      handler: function (title, idx) {
        type = 'mp3'
        url = object.url
        if (idx) {
          url = object.flac.url
          path = type = 'flac'
        }
        path = splicPath(object.title.text, object.singer.singer, type)
        if (!$file.exists(path)) {
          $thread.background({
            delay: 0,
            handler: function () {
              $("musicPageDown").src = deleteicon
            }
          })
          isDownload = object
          $http.download({
            url: url,
            progress: function (bytesWritten, totalBytes) {
              var percentage = bytesWritten * 1.0 / totalBytes
            },
            handler: function (resp) {
              saveMusic(resp.data, path, object)
            }
          })
        }
        else $ui.toast("当前歌曲已下载...")
      }
    })
  }
  else
    $ui.toast("当前已有下载任务,请稍后...")
}

function openURL(url) {
  $ui.push({
    props: {
      title: url
    },
    views: [{
      type: "web",
      props: {
        url: url
      },
      layout: $layout.fill
    }]
  })
}

